import React from 'react' ;
import Sidebar from './SidebarEtudiant';
import '../App.css';
import { FaRegLightbulb, FaHandPointer } from 'react-icons/fa';
export default class Etudiant extends React.Component{
    render(){
        return(
            <div className="Dash">
                    <Sidebar/>
                    <div className="st-home">
                        <FaRegLightbulb id="tip-icon" size="120"/>
                        <h1 id="tip-title">One Day .. Two Tips</h1>
                        <div id="tips-row">
                            <div id="tip-card-1">
                                <FaHandPointer id="tip-icon" size="50"/>
                                <p>tip1</p>
                            </div>
                            <div id="tip-card-2">
                                <p>tip2</p>
                            </div>
                        </div>
                    </div>
            </div>
        );
    }
}
